(function() {
    

var inTime = $('.company > .common_table  tr:eq(1) td:last-child').text();
var outTimeEl = $('.company > .common_table  tr:eq(2) td:last-child');


var inTimeMoment  = moment(inTime,"HH:mm A"); 

var targetTime = inTimeMoment.add({hours:9, minutes:30}).format('hh:mm A');

outTimeEl.html(outTimeEl.html() + ' (Out time should be: ' + targetTime + ")");

})();